import React from "react";
import './education.css'

function Education(){
    return(
        <div className="contendor-edu">
            <h3 className="tittle-education">Education</h3>
            <div className="education-contenedor">
                <div className="education-apartado"><p className="texto-edu">UNIVERSITY TECHNICIAN IN PROGRAMMING</p></div>
                <div className="education-apartado"><p className="texto-edu">F.A.S.T.A. (HIGH SCHOOL)</p></div>
                <div className="education-apartado"><p className="texto-edu">PROGRAMMING COURSE</p></div>
                <div className="education-apartado"><p className="texto-edu">ENGLISH COURSE</p></div>
                <div className="education-apartado"><p className="texto-edu">REACT COURSE freeCodeCamp</p></div>
                <div className="education-apartado"><p className="texto-edu">JAVASCRIPT COURSE lucas Dalto</p></div>
            </div>
        </div>
    );
};

export default Education;
